import React from "react";
import { Route } from "react-router-dom";
import "./App.css";
import HomePage from "./pages/homepage/homepage.component";

const hatsPage = () => (
  <div>
    <h1>HATS PAGE</h1>
  </div>
);

function App() {
  return (
    <div>
      <Route exact={true} path="/" component={HomePage} />
      <Route path="/hats" component={hatsPage} />
    </div>
  );
}

export default App;
